import React from 'react';
import './Users.css'
export default function Users({ data }) {

    return (
        <div className='usersSideBar'>
            {
                data.map((user) => {
                    return (
                        <div key={user.id} className='user'>
                            <p>{user.username}</p>
                        </div>
                    )
                })
            }
        </div>
    )
}
